import React from "react";

import './Feds.css';
import Ho from './Picture/home.png' ;

function Fed() {
    return (
      <div className="Fed">
        <div className="Box" ><img src={Ho} /></div>
        <img src={Ho} />
        <img src={Ho} />
        <img src={Ho} />
        <img src={Ho} />
        <img src={Ho} />
      </div>
    );
  }
  
  export default Fed;
